import React, { Component } from 'react';
import FirstComponent from './components/learning-exemples/FistComponent';
import SecondComponents from './components/learning-exemples/SecondComponents';
import ThirdComponents from './components/learning-exemples/ThirdComponents';
import CounterButton from './components/counter/Counter';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <CounterButton by={1} />
        <CounterButton />
        <CounterButton by={5} />
        <CounterButton by={10} />
      </div>
    );
  }
}

class LearningComponents extends Component {
  render() {
    return (
      <div className="LearningComponents">
        My Hello WorlD
        <FirstComponent />
        <SecondComponents />
        <ThirdComponents />
      </div>
    );
  }
}


export default App;
